import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          id: "1",
          name: "Virendra",
        },
        {
          id: "2",
          name: "Vishal",
        },
        {
          id: "3",
          name: "Aniketh",
        },
        {
          id: "4",
          name: "Muragesh",
        },
        {
          id: "5",
          name: "Shashank",
        },
      ],
    };
  }

  componentDidMount() {}

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return (
            <div key={monster.id}>
              <h1>{monster.name}</h1>
            </div>
          );
        })}
      </div>
    );
  }
}

export default App;
